import React, {useState} from 'react'


const Feed = () => {

  const [posts, setPosts] = useState('')

  const handleCreate = (posts) => {
    return <div>
        <span>
            {posts}
        </span>
    </div>
  }

  return (
    <div>
        <div>
            <textarea 
                placeholder = 'Type to create new post...'
                value = {posts}
                onChange={(e) => setPosts(e.target.value)}>
            </textarea>
            <button
            onClick={() => handleCreate()}> Create </button>
        </div>
        <div>
            <div className = 'post'>
                <span> {posts} </span>
            </div>          
        </div>
    </div>
  )
}

export default Feed
